// UncleJerry23/steven-universe-graphql-api 
import './style.css';
import logo from './../../img/logo.png'


function Home() {

  return (
    <>
      <main className = 'main'>
        <img className = 'logo' src={logo} alt='logo steven universe'/>

        <articule>Characters</articule>
        <articule>Episodes</articule>
        <articule>Songs</articule>
      </main>

    </>
  );
}

export default Home;
